import React from "react";
import Card from "./Card";

export default function Flex_Card(){

    return(

        <div className="flex-card">
             <Card 
                img="zaderea.png"
                rating="5.0"
                reviewCount={6}
                country="USA"
                title="Life Lessons with Katie Zaferes"
                price={136}
            />

            <Card 
                img="zaderea.png"
                rating="1.0"
                reviewCount={6}
                country="RO"
                title="Cand pierzi nu castigi"
                price={136}
            />

            <Card 
                img="poza_stagii.jpg"
                rating="10.0"
                reviewCount={200}
                country="RO"
                title="Web Dev Master"
                price={200}
            />

<Card 
                img="poza_stagii.jpg"
                rating="10.0"
                reviewCount={100}
                country="RO"
                title="League Coch Diamond"
                price={300}
            />
        </div>

    )
}
